import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Typography from '@material-ui/core/Typography';
import styled from 'styled-components';
import CheckCircleOutlineIcon from '@material-ui/icons/CheckCircleOutline';

function DetailCatalog() {
  const useStyles = makeStyles(theme => ({
    root: {
      flexGrow: 1,
      marginTop: '90px'
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary
    }
  }));
  const WrapPadding = styled.div`
    padding-top: 20px;
  `;

  const WrapIcon = styled.div`
    padding: 20px;
    background-color: yellow;
  `;

  const classes = useStyles();
  return (
    <div className={classes.root}>
      <Container>
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <img
              src="./assets/img/image4.JPG"
              class="img-fluid"
              alt="Responsive image"
            />
          </Grid>
          <Grid item xs={6}>
            <Typography variant="h5" className="titleCatalog">
              Safina
            </Typography>
            <div className="hr"></div>
            <WrapPadding>
              <p className="price">Rp 400.000</p>
            </WrapPadding>
            <div className="hr"></div>
            <WrapPadding>
              <p className="price">Warna *</p>
              <Grid container item xs={12}>
                <div className="text-center">
                  <WrapIcon>
                    <CheckCircleOutlineIcon />
                  </WrapIcon>
                </div>
              </Grid>
            </WrapPadding>
            <div className="hr"></div>
            <WrapPadding></WrapPadding>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

export default DetailCatalog;
